import {TailSpin} from 'react-loader-spinner'

const Spinner = () => {
    return (
        <TailSpin
            height="80"
            width="80"
            color="#4fa94d"
            ariaLabel="tail-spin-loading"
            radius="1"
            wrapperStyle={{
                margin: 'auto',
                width: '50%',
            }}
            wrapperClass=""
            visible={true}
        />
    )
};

export default Spinner;
